import React from 'react';
import './StateDetails.css'; // Import the new CSS file

const StateDetails = () => {
  // Sample state details data, update with your actual data
  const stateDetails = {
    name: 'Andhra Pradesh',
    culture: 'Rich cultural heritage...',
    dress: 'Traditional attire...',
    food: 'Delicious local cuisine...',
    festivals: 'Colorful and vibrant festivals...',
    temples: 'Famous temples...',
    // Add more details as needed
  };

  return (
    <div className="state-details-container">
      <h2>{stateDetails.name} Details</h2>
      <table className="state-details-table">
        <tbody>
          <tr>
            <th className="detail-label">Culture</th>
            <td className="detail-value">{stateDetails.culture}</td>
          </tr>
          <tr>
            <th className="detail-label">Dress</th>
            <td className="detail-value">{stateDetails.dress}</td>
          </tr>
          <tr>
            <th className="detail-label">Food</th>
            <td className="detail-value">{stateDetails.food}</td>
          </tr>
          <tr>
            <th className="detail-label">Festivals</th>
            <td className="detail-value">{stateDetails.festivals}</td>
          </tr>
          <tr>
            <th className="detail-label">Temples</th>
            <td className="detail-value">{stateDetails.temples}</td>
          </tr>
          {/* Add more rows for additional details */}
        </tbody>
      </table>
    </div>
  );
};

export default StateDetails;
